import React from "react";
import firebase from "firebase";

import { dataToString } from "../../calculations.js";
import Chart from "./../../images/Group 5.png";

function CalculationCell({ cell, cellID, data }) {
  return (
    <>
      <img className="chart" src={Chart}></img>
      This is a calculation cell
      {dataToString(data)}
    </>
  );
}

export default CalculationCell;
